import React from "react";
import { Link } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { GoogleLogout } from "react-google-login"
import { logOutGoogle } from "../../actions/actions";

import "./NavBar.css";

const Nav = () => {

    const name = useSelector((state) => state.user)
    console.log(name)
    const dispatch = useDispatch();

    // const GoogleLogoutButton = props => (
    //     <GoogleLogout
    //     clientId="58941748087-vv5lmt8hnkri961a7pdrdp9pjsj500vl.apps.googleusercontent.com"
    //     buttonText="Logout"
    //     onLogoutSuccess={() => props.logout()}
    //     onLogoutFailure={err => console.log(err)}
    //     /> && window.location.reload()
    // )

    function logOut() {
        dispatch(logOutGoogle());
    }
        if (name.length === 0) {
            return (
                <div className="container-nav">
            <div className="logo">
                <Link to="/">S.</Link>
            </div>
            <ul className="ul-nav">
                <li>
                    <Link to="/conocenos">Conocenos</Link>
                </li>
                <li>
                    <Link to="/foro">Foro</Link>
                </li>
                <li>
                    <Link to="/lugaresseguros">Lugares Seguros</Link>
                    <div className="nav-line"></div>

                </li>

                <li>

                    <Link to="/iniciasesion">Iniciar Sesión</Link>


                </li>
                <li>

                    <Link to="/registrate">Registrate</Link>

                </li>

            </ul>

        </div>
        )
        } else {
            return (
                <div>
                <div className="logo">
                <Link to="/">S.</Link>
                </div>
                <ul>
                <li>
                    <Link to="/conocenos">Conocenos</Link>
                </li>
                <li>
                    <Link to="/foro">Foro</Link>
                </li>
                <li>
                    <Link to="/lugaresseguros">Lugares Seguros</Link>
                    <div className="nav-line"></div>

                </li>
                <h5>{name}</h5>
                <button onClick={logOut}>Cerrar sesión</button>
                </ul>
                </div>
            )
        }
}

export default Nav;
